import React from 'react'
import { useSelector } from 'react-redux'

const Users = () => {
  const blogs = useSelector(state => state.blogs)
  let users = []
  blogs.forEach(blog => {
    users = [...users, blog.user.name]
  })
  console.log(users)

  let countedNames = users.reduce(function (allNames, name) {
    if (name in allNames) {
      allNames[name]++
    }
    else {
      allNames[name] = 1
    }
    return allNames
  }, {})
  console.log(countedNames)

  let result = Object.keys(countedNames).map(e => ({
    name: e, count: countedNames[e]
  }))
  console.log(result)

  return(
    <div>
      <h1>Users</h1>
      <table>
      <tr>
        <th></th>
        <th>blogs created</th>
      </tr>
          {result.map(user =>
            <div key={user.name}>
              <p>{user.name}</p>
              <p>{user.count}</p>
            </div>
          )}
      </table>
    </div>
  )
}

export default Users
